import React, { useState, useEffect } from 'react';
import axios from 'axios';
import gallery from '../../Assets/beautiful-scenery-summit-mount-everest-covered-with-snow-white-clouds.jpg'
import { Stepper, Step, StepLabel, StepContent, Typography } from '@mui/material';

const DaySchedule = () => {
    const steps = ['Step 1', 'Step 2', 'Step 3'];
    return (
        <div>
            <div>
                <img src={gallery} className='gallery-img' />
            </div>
            <div className='gallery-head'>DAY SCHEDULE</div>

            <Stepper orientation="vertical">
      {steps.map((label, index) => (
        <Step key={index}>
          <StepLabel>{label}</StepLabel>
          <StepContent>
            <Typography>{`This is the content of ${label}`}</Typography>
          </StepContent>
        </Step>
      ))}
    </Stepper>
        </div>
    )
}

export default DaySchedule
